/* ......TYPOGRAPHY....... */

*,
*::after,
*::before {
  box-sizing: border-box;
}

html {
  /* font-size: 1.5rem; */
  box-sizing: border-box;
}

/* :-webkit-scrollbar {
  width: 0;
} */

/* colors */
:root {
  --color-primary: #2584ff;
  --color-secondary: #00d9ff;
  --color-accent: #ff3400;
  --color-heading: #1b0760;
  --color-body: #918ca4;
}

body {
  font-family: inter, Arial, Helvetica, sans-serif;
  color: var(--color-body);
  line-height: 1.2rem;
  width: auto;
}

/* Navigation bar */

.brand {
  margin-top: 0.5rem;
}
.nav {
  background-color: black;
  display: flex;
  justify-content: space-between;
  align-items: center;
  flex-wrap: wrap;
  padding: 0;
}

.menu-list {
  list-style: none;
  width: 100%;
  margin: 0;
  padding: 0;
  /* display: hidden; */
}

.nav-item {
  font-size: 1.3rem;
  padding: 0.3rem 1rem;
  border-bottom: 2px solid #222;
}
.nav-item > a {
  color: #d2d0bd;
}
.nav-item > a:hover {
  transition: all 0.3s;
  color: white;
}

.iconMenu {
  fill: white;
  width: 60px;
  height: 60px;
  margin: 10px;
}
.menuBtn {
  opacity: 0.5;
  transition: all 0.2s;
  cursor: pointer;
}
.collapsible-expanded .menuBtn {
  opacity: 1;
  box-shadow: 0 0 2px 3px;
  border-radius: 7px;
}

@media screen and (min-width: 768px) {
  .icon {
    width: 60px;
    height: 60px;
  }
  .icon-small {
    width: 40px;
    height: 40px;
  }
  .iconMenu {
    display: none;
  }

  .menu-list {
    width: auto;
    display: flex;
    max-height: 100%;
    opacity: 1;
  }

  .nav-item {
    border: 0;
  }
}

/* Hero */

.hero {
  background-color: black;
  text-align: center;
  padding: 0 1rem 3rem;
  clip-path: polygon(0 0, 100% 0%, 100% 90%, 0 100%);
}
/* hero ___ content */

.hero__content {
  padding: 1rem;
}
.hero__heading {
  padding: 1rem 0;
  margin: 0;
  font-size: 50px;
  line-height: 3rem;
  color: white;
}
.hero__para {
  letter-spacing: 1px;
  line-height: 2rem;
  padding-left: 0;
  margin: 0;
  font-size: 25px;
}

.hero__btn {
  margin: 1rem 0;
  padding: 0.8rem 2.5rem;
  font-size: 1rem;
  max-width: fit-content;
}
/*  hero__image */
.hero__image {
  margin-top: -1rem;
  width: 100%;
  /* margin-top: -1rem; */
}

@media screen and (min-width: 768px) {
  .hero {
    display: flex;
    justify-content: center;
    align-items: center;
    clip-path: polygon(0 0, 100% 0%, 100% 85%, 0 100%);
  }
  .hero__heading {
    line-height: 3rem;
  }
  .hero__content {
    text-align: left;
    width: 50vw;
  }
  .hero__image {
    padding: 0;
    width: 50vw;
    margin-bottom: 200px;
  }
}

/* heading */

h1,
h2,
h3 {
  color: var(--color-heading);
  padding-left: 0.5rem;
}

h3 {
  margin-bottom: 0.5rem;
}

/* BigScreen media query for typography */
@media screen and (min-width: 1024px) {
  body {
    font-size: 1.2rem;
    line-height: 1.5rem;
  }
  h1 {
    font-size: 1rem;
  }
}

/* ......LINKS...... */
a {
  text-decoration: none;
}

/* Badges */

.badges {
  margin: 0.5rem;
}

.badge {
  color: white;
  border-radius: 20px;
  white-space: nowrap;
  padding: 0.25rem 1rem;
  font-weight: 600;
  font-size: 100%;
}

.badgeOne {
  background-color: var(--color-primary);
}

.badgeTwo {
  background-color: var(--color-secondary);
}

/* media query for badges */
@media screen and (min-width: 1024px) {
  .badges {
    font-size: 70%;
  }
}

/* lists */

/* horizontal */
.list {
  padding-left: 0;
  list-style: none;
  color: var(--color-heading);
}

.listItem {
  display: inline-block;
  margin: 5px;
  font-weight: bold;
}

/* tickedlist */
.tickedList {
  list-style-image: url(../images/tick.svg);
  color: var(--color-heading);
}

.tick-list-item {
  padding-left: 0.5rem;
  margin-bottom: 0.8rem;
}

/* icons */

.icon {
  width: 50px;
  height: 50px;
}

.icon-small {
  width: 30px;
  height: 30px;
}

/* .........computerIcon */
.iconComputer {
  fill: var(--color-accent);
  padding-top: 0.5rem;
}
.computerContainer {
  display: inline-flex;
  margin: 2rem 2rem 0 2rem;
  align-items: center;
}

/* ...line icon... */
.lineContainer {
  margin: 0.5rem;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
}
.lineBox {
  /* height: 100%; */
  display: flex;
  align-items: center;
  position: relative;
}
.iconLine {
  margin-left: 1rem;
  height: 30px;
}

.lineContainer-quote {
  color: var(--color-heading);
  font-style: italic;
  padding: 0px;
  margin: 0;
}
.lineName {
  color: var(--color-accent);
  padding: 0 0 0 10px;
}
.companyName {
  color: darkgrey;
  font-size: 60%;
  position: absolute;
  bottom: -1.5rem;
  left: 120px;
  font-style: italic;
  padding: 0;
  margin: 0;
}

.iconQuotes-span {
  background-color: var(--color-accent);
  width: 60px;
  height: 60px;
  border-radius: 100%;
  padding: 0.5rem 0.6rem;
  position: absolute;
  fill: white;
  top: 25px;
  right: -30px;
  display: flex;
  justify-content: center;
  align-items: center;
}

/* media query for icons */

@media screen and (min-width: 1024px) {
  .mediaContainer {
    font-size: 90%;
  }
}

/* buttons */

.btn {
  border-radius: 30px;
  margin-top: 5px;
  padding: 0.5rem 1.5rem;
  font-weight: bold;
  cursor: pointer;
  text-align: center;
}

.btn-buy {
  background-color: var(--color-secondary);
  border: 3px solid var(--color-heading);
  color: white;
  display: inline-block;
  width: 50%;
  margin: 0.5rem 0 0.5rem 1rem;
}

/* inputs */
.input-sec {
  margin: 1.5rem;
}

.input-group {
  height: 4rem;
  margin: auto;
  max-width: 670px;
  border: 0;
  border-radius: 50px;
  box-shadow: 0 0 20px 10px lightgrey;
  display: flex;
}

.input-main {
  width: 100%;
  margin: 1rem;
  outline: 0;
  flex-grow: 1;
  color: var(--color-heading);
  border: 0;
}

::placeholder {
  color: lightgrey;
}

.btn-search,
.hero__btn__style {
  border-radius: 50px;
  background-color: var(--color-accent);
  display: inline-block;
  border: 0;
  color: white;
  font-weight: 600;
}

.btn-search {
  display: flex;
  align-items: center;
  justify-content: center;
  margin-left: 0;
  margin: 5px 5px 5px 0;
}
.icon-search {
  fill: white;
  margin-right: 5px;
  width: 1rem;
}
/* price box */
.price-box {
  text-align: center;
  margin-top: 1rem;
}

.price {
  display: inline-block;
  color: var(--color-heading);
  margin: 5px;
  padding: 5px;
}

.price:hover {
  background-color: var(--color-secondary);
  border-radius: 30px;
}

/* media query for the buttons and input */
@media screen and (min-width: 768px) {
  .price-box {
    display: flex;
    justify-content: center;
  }
  .price-row-one,
  .price-row-two {
    width: fit-content;
  }
}

.card-sec {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}

.card {
  margin: 2rem;
  margin-bottom: 0;
  width: 16rem;
  height: fit-content;
  border: 0;
  box-shadow: 0 0 20px 1px lightgrey;
  position: relative;
  transition: all 0.3s ease-in-out;
}
.card:hover {
  transform: scale(1.1);
}

.popular-card {
  box-shadow: 0 0 20px 10px lightgrey;
}

.popular-card .card-para {
  margin: 1.5rem 0.5rem;
}
.cardHeader {
  padding: 1rem;
  color: white;
  background-color: #00d9ff;
  width: 100%;
  height: 30%;
}
.popular-card-header {
  background: var(--color-primary);
}

.popular-card-header::before {
  content: url(../images/popular.svg);
  width: 30px;
  display: inline-block;
  position: absolute;
  top: -4px;
  right: 3%;
}
.card-para {
  padding: 1rem;
  margin: 0;
}
/* card... */
@media screen and (min-width: 768px) {
  .card-sec {
    flex-direction: row;
  }
}

/* ...grid */
.testimonial-header {
  text-align: center;
}
.testimonial-header > h1 {
  line-height: 2rem;
}

.card-two {
  max-width: 100%;
  margin: 2rem;
  padding: 1rem;
  height: 100%;
  border: 0;
  border-radius: 1rem;
  box-shadow: 0 0 20px 10px lightgrey;
}
.grid-sec {
  margin-bottom: 1rem;
  max-width: 100%;
  padding: 1rem;
}
.man {
  width: 100%;
}

.image-container {
  position: relative;
}

@media screen and (min-width: 768px) {
  .grid-sec {
    display: grid;
    grid-template-columns: 1fr 1fr;
  }

  .lineContainer-quote {
    margin: 0.5rem 0.5rem 0rem 1.8rem;
    padding: 0;
    font-size: 20px;
    line-height: 25px;
  }
}

/* callout */

.callout {
  padding: 0.5rem 1rem;
  margin: 1rem;
  background-color: var(--color-primary);
  color: white;
  border-radius: 10px;
  display: flex;
  flex-direction: column;
  text-align: center;
  align-items: center;
}

.callout-heading {
  margin: 1rem 0 0.8rem;
  color: white;
  line-height: 1.1rem;
}

.call-btn {
  background-color: var(--color-secondary);
  border: 0;
  border-radius: 50px;
  color: #fff;
  width: 10rem;
}

@media screen and (min-width: 768px) {
  .callout {
    text-align: left;
    flex-direction: row;
    justify-content: space-between;
  }

  .callout-para,
  .callout-heading {
    padding: 0 0 0 1rem;
  }
  .callout-para {
    margin-bottom: 1rem;
  }

  .call-btn {
    margin-left: 1rem;
  }
}

@media screen and (min-width: 1024px) {
  .callout {
    font-size: 1rem;
    line-height: 1.2rem;
  }
}

/* collapsible */

.collapsible {
  font-size: 1rem;
  padding: 1rem;
}

/* majbooran deni pari sab khrb hoaraha tha */
.nav {
  padding: 0;
}

.collapsible-heading {
  margin: 0 0 5px;
  padding: 0;
}

.collapsible-header {
  display: flex;
  justify-content: space-between;
  margin-bottom: 0.5rem;
}

.collapsible-easy {
  transform: rotate(-90deg);
  transition: transform 0.3s;
}

.collapsible-expanded .collapsible-easy {
  transform: rotate(0);
}

.collapsible-content {
  line-height: normal;
  max-height: 0;
  overflow: hidden;
  opacity: 0;
  transition: all 0.3s;
}
.collapsible-expanded .collapsible-content {
  max-height: 100vh;
  overflow: visible;
  opacity: 1;
}

/* ....features ......*/

.feature-header {
  margin-top: 1.5rem;
  text-align: center;
}

.feature-header > h2 {
  line-height: 1.5rem;
  padding: 0;
}

.feature-one {
  display: flex;
  flex-direction: column-reverse;
}
.box-one,
.box-two {
  width: 100%;
}

.iconClock {
  fill: var(--color-heading);
  background-color: lightblue;
  border-radius: 50px;
  padding: 5px;
}

.feature-box-one {
  padding: 2rem 2rem 2rem 2rem;
}
.feature-box-two-image {
  padding: 1rem;
  width: 100%;
}
.feature-para {
  margin-bottom: 5px;
  line-height: 1.3rem;
}

.box-one > h2 {
  margin: 1rem 0;
  padding: 0;
}

/* learn more red link */
.learnMore {
  color: var(--color-accent);
  font-weight: bold;
  padding-top: 8px;
}
.learnMore::after {
  content: "-->";
  margin-left: 5px;
}

.learnMore:hover::after {
  margin-left: 10px;
  transition-duration: 0.3s;
}

/* BigScreen media query for  RED LINKS */

@media screen and (min-width: 768px) {
  .feature-one {
    flex-direction: row;
    align-items: center;
    justify-content: center;
    padding: 2rem;
  }
  .box-one,
  .box-two {
    width: 100%;
  }
  .feature-box-one {
    padding-right: 0;
  }
  .feature-para {
    line-height: 1.5rem;
  }
}

/* footer */
.footer {
  padding: 1rem;
  background: black;
}
.footer-items {
  line-height: 2rem;
  margin-top: 3rem;
}
.product-header {
  display: flex;
  justify-content: space-between;
}
.footer-heading {
  padding: 0;
  margin: 0;
  color: white;
}

.footer-menu-btn {
  width: 2.5rem;
  height: 2.5rem;
  margin: 0 5px 0 0;
}
.footer-image-copyright {
  margin-top: 1rem;
}
.footer-logo {
  padding: 0;
  margin: 8px 0 0 -15px;
}
.footer-copyright {
  padding: 0;
  margin: 0;
  margin-top: -10px;
}

@media screen and (min-width: 768px) {
  .footer-items {
    display: flex;
    flex-direction: row-reverse;
    justify-content: space-between;
  }
  .product {
    max-width: 65vw;
    width: 100%;
    margin-left: 1rem;
  }
  .footer-image-copyright {
    margin-top: 0;
  }
  .footer-logo {
    margin-top: 0;
  }
}
